import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear and take screenshot
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Check if cart has items and remove first item
    const removeButtons = await page.$$('.remove-item');
    if (removeButtons.length > 0) {
      await removeButtons[0].click();

      // Wait for cart to update and take final screenshot
      await page.waitForTimeout(1000); // Brief pause for UI update
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_item_removed.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_item_removed.png'));

      // Get updated cart count
      const cartText = await page.$eval('.cart', el => el.textContent.trim());
      const cartCount = parseInt(cartText.match(/\d+/)[0]);

      return {
        success: true,
        action: "Removed item from cart",
        extractedData: {
          cartCountAfterRemoval: cartCount
        },
        screenshots,
        error: null
      };
    } else {
      return {
        success: true,
        action: "Cart was already empty, no items to remove",
        extractedData: {
          cartCountAfterRemoval: 0
        },
        screenshots,
        error: null
      };
    }
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
